import ExpenseItem from './components/ExpenseItem';

function App() {
  const expenses = [
    {title: 'Car Insurance', amount: 250, date: new Date(2021, 2,28)},
    {title: 'Dog Insurance', amount: 250, date: new Date(2021, 2,28)},
    {title: 'Car Insurance', amount: 250, date: new Date(2021, 2,28)},
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
